descriptions:
{'es-ES': 'A 5 min. de Lugo, en la zona de Rubiás. Casa con encanto hecha de piedra y losa tradicional, independiente y situada en preciosa finca cerrada de 3.000m2, con árboles frutales, pozo, garaje.. .
Distribución en cocina amplia totalmente equipada, salón con chimenea francesa, tres dormitorios y dos baños completos, todas las estancias exteriores y con vistas. 

Llámanos o envíanos un email para concertar una visita o recibir más información.'}

{'es-ES': 'Se vende apartamento de 42 m2.Distribuido en dos habitaciones ( una amplia y otra más pequeña con literas), un baño completo con ducha, salón comedor luminoso y cocina amueblada. Armario hall de entrada. Calefacción de gasoil contador individual.Dispone de ascensor. No tiene plaza de garaje ni trastero. 
 Ideal para una pareja o inversión ( alquiler asegurado), rodeado de multitud de servicios cercanos, zonas verdes, supermercados, buenas salidas hacia el CEAO, HULA , AS TERMAS....

 TENEMOS MÁS VIVIENDAS COMO ESTAS CONSÚLTENOS EN www.merkokasa.es'}

{'es-ES': 'Vivienda en "Montero Rios", zona céntrica a un paso de la muralla con salidas de la ciudad inmediatas hacia el HULA, cerca de zonas verdes.

En un edificio del año 2010, seminuevo, en buen estado, calefacción central.

Con una superficie construida de 85 m2 aproximados. Distribución de tres dormitorios. Salón comedor muy luminoso, Cocina amueblada con zona diferenciada para poner una mesa. Un baño completo con plato de ducha. Con plaza de garaje y trastero.'}

{'es-ES': 'En la Ribeira Sacra, una de las zonas más bonitas de Galicia, cerca de Taboada, Lugo, se encuentra esta propiedad. La maravillosa comarca de la Ribeira Sacra alberga atractivos naturales y culturales impresionantes. Es uno de los territorios de Galicia más visitados y con mayor futuro. Taboada, tiene todos los servicios necesarios y junto con Chantada, son los núcleos urbanos más relevantes de la Ribeira Sacra y de Galicia.
La casa de piedra está situada en Cicillón –A LAGOA. Ayuntamiento de Taboada (Lugo). La construcción es de 381 m2 constando de vivienda, comedor, pajar, garaje, bodega, horreo, horno de leña y aira). La casa tiene 2 pozos de agua y una amplia finca con castaños, robles, árboles frutales y dos huertas, una de ellas con un gallinero.
También se dispone de varias fincas en caso de que se esté interesado.quot;

Teléfonos de contacto:'}

{'es-ES': 'Se vende ático reformado de 90m2 .Distribuido en salón amplio y luminoso, cocina equipada con todos los electrodomésticos,zona tendedero ( lavadora/secadora) , tres habitaciones ( dos de ellas abuhardilladas con velux y armario empotrado pequeños, la otra habitación con armario empotrado), un baño con plato de ducha y armario empotrado hall de entrada. Calefacción con acumuladores eléctricos bajo consumo, agua caliente termo. Dispone de ascensor ( reformado). Posibilidad de plazas de garaje cercanos desde 13.000-18.000€ y trasteros 2.000-3000€ ( consúltenos).
 La vivienda está reformada, amplitud y luminoso, ventanas de PVC, galería cerrada con buen aislamiento ( dispone de una campana extractora  y mesado), armario hall de entrada empotrado, luces led. Ideal para una pareja  que quiera vivir cercano a la Avd. Coruña con multitud de servicios cercanos, zonas verdes, centros comerciales, farmacias, zonas de restauración, herbolisterías, parada bus y buenas salidas hacia el Ceao, Hula...

 TENEMOS MÁS VIVIENDAS COMO ESTAS, CONSÚLTENOS EN www.merkokasa.es'}

{'es-ES': 'Se vende piso a estrenar de 86m2.Distribuido en cocina ( sin amueblar), zona lavandería independiente, salón comedor amplio y luminoso , tres habitaciones con armarios empotrados ( la habitación principal con baño plato de ducha) y otro baño completo en el pasillo. Calefacción de gas ciudad con caldera independiente. Dispone de ascensor, plaza de garaje  y dos trasteros ( en el bajocubierta y otro anexo a la plaza de garaje). 
 Ideal para una familia que quiera vivir con multitud de servicios cercanos, zonas verdes, estación de tren, buenas comunicaciones con salidas y entradas a la ciudad de Lugo, centro comercial, supermercados, colegios...

 TENEMOS MÁS VIVIENDAS COMO ESTAS, CONSÚLTENOS EN www.merkokasa.es'}

{'es-ES': 'Ref.:2985 Chalet a 10 minutos del centro de Lugo, con una parcela de 10.000 m2, dividido en sótano, semisótano(parrilla, cocina de butáno y electrica, lavavajillas, fregadero, salon comedor, sala de juegos, dormitorio, baño, sala de calderas, tendedero, bodega y garaje para cinco coches). En la planta baja, cocina completa con isla, bancos abatibles hechos a medida, lavanderia, sala con chimenea, salon comedor, despacho, un domitorio amplio y baño completo.

En la segunda planta hay tres dormitorios amplios, la habitacion principal cuenta con terraza cerrada y un amplio baño completo con bañera de hidromasaje. El salon mide 70 m2 de una gran calidad y exclusividad.

En el jardin hay tres pozos, uno de barrena y dos artesianos, la finca tiene cuatro entradas independientes. el deposito de la calefaccion tiene capacidad de 7600 litros y se encuentra oculto bajo jardin.'}

{'es-ES': 'Se vende casa de 150m2.Distribuido en dos plantas; planta baja encontramos salón comedor amplio con una pequeña estufa ,un aseo y cocina equipada con salida hacia el patio donde se encuentra la barbacoa con jardín de 2000m2. Parte alta: está sin terminar suelos de madera y grandes ventanales, vigas de madera, paredes de piedra.No tiene placa. Varios anexos al lado de la vivienda, como un invernadero y almacenaje para meter coches o herramientas superficie de  55m2 y otra de 14m2. Pozo, estanque de peces, pérgola, agua de traida, árboles frutales, finca cerrada. Al lado de la casa una finca dedicada a labradio de 1.665m2 .
 La vivienda está rehabilitada en 2013, paredes de piedra,amplia, luminosa, ventanas de pcv, buenas comunicaciones a 3.73 kms del centro de salud de begonte, farmacias, supermercados, fruterías, buses.....Autovía A8 cercana. 

 TENEMOS MÁS VIVIENDAS COMO ESTAS, CONSÚLTENOS www.merkokasa.es'}

{'es-ES': 'Casa en Ferreira do Valadouro, un pueblo pequeñito con mucho encanto y multitud de facilidades (supermercados, bancos, librerías, peluquerías, mercado todos los sábados,... ) muy cerca de Foz, la playa de las Catedrales o Ribadeo, lugares idílicos de la Mariña lucense.

Dispone de 3 plantas dispuestas de la siguiente forma, en la primera planta hall de entrada, salón, cocina y salida al patio de 20 metros con su caseta de piedra, en la segunda planta 3 habitaciones y baño y en la tercera planta el desván, al que se le puede dar altura y reformar para aumentar los espacios de la vivienda.

En definitiva, una casa llena de oportunidades que está esperando su nuevo dueño!'}

{'es-ES': 'Se vende piso de 100m2. Distribuido en 3 habitaciones, 1 baño completo y un aseo, cocina equipada con salida hacia el balcón, salón comedor amplio y una terraza de 2*3 m2. Calefacción central gas ciudad con contador individual. Esta vivienda no dispone de ascensor, sería un segundo fácil de subir las escaleras, no tiene garaje.
 A escasos metros de Ramón Ferreiro,  al lado  de institutos, supermercados, zonas de ocio, parque e incluso andando al centro  a 2 minutos , paradas de bus. 

 TENEMOS MÁS VIVIENDAS COMO ESTA EN NUESTRA WEB www.merkokasa.es'}

{'es-ES': 'Chalet adosado a un paso del centro de Lugo, en república argentina, con acceso a piscina. Con vistas del rio miño y todos los dormitorios con armario empotrados. Con dos terrazas una con vistas al rio miño de 60 m2 aprox.

Seminueva con un superficie construida de 300 m2 aproximados. Con cinco dormitorios todos exteriores y cuatro baños completos, Amplia cocina y salón comedor, planta sótano para garaje. Y una buhardilla arreglada forrada en madera.

La distribución en planta baja es de garaje amplio, dos habitaciones para lavandería e instalaciones un salón y acceso a la terraza. La planta baja tenemos la entrada con porche y hall, cocina equipada, baño y salón con vistas a rio miño. La primera planta tiene la habitación principal con vestidor y baño y las vistas del rio, dos habitaciones mas y un baño completo. La segunda planta tiene un despacho con balcón hacia el río, un baño completo y una habitación. En el bajo cubierta esta la buhardilla que sirve como otro salón o habitación de juegos.'}

{'es-ES': 'Casa independiente con finca cerrada de 341m2 en Lugo. Todos los servicios próximos: bus urbano, centro comercial.. . y a 2,6 km del centro de ciudad. 

Distribución en planta baja, consta de cocina, salón -comedor, dos dormitorios y baño completo. 

La finca cuenta con dos accesos (peatonal y para coches) y varios alpendres con superficie de 50m2 y uso de almacén.'}

{'es-ES': 'En el centro de Lugo, en "rua Anduriñas", con servicios de bario, tranquilidad, zonas de paseo, transportes, salidas de ciudad sencillas, etc. Con una ubicacion muy buena.

Edificio del año 1970, con ascensor, zonas comunes en buen estado, en fachada contaba con un balcón actualmente esta cerrado con galería.

Piso de 4 dormitorios, con un baño completo, aseo. Una superficie aproximada de 130 m2 construidos y 90 m2 útiles. Vivienda en buen estado para actualizar. Tambien tiene una segunda galería tendedero hacia la parte del patio de manzana. Dispone de plaza de garaje y trastero.'}

{'es-ES': 'Se vende piso de 107m2. Distribuido en cocina americana equipada  luminosa con salón amplio con grandes ventanales luz directa, zona lavandería y despensa, tres habitaciones ( principal  con vestidor y un baño completo con plato de ducha) y otro baño completo con ducha. Suelo radiante .Calefacción gas ciudad individual  con contador. Dispone de ascensor, plaza de garaje opcional  (10.000€) a mayores y trastero.
 La vivienda está lista para entrar a vivir, con buenas calidades y acabados, sanitarios y griferías termotáticas, carpintería lacada en blanco.Su ubicación es excelente a 5 minutos del centro amurallado, zonas verdes y ajardinadas, centros médicos, librerías, supermercados y buenos accesos hacia el Hula. 


 TENEMOS MÁS VIVIENDAS, COMO ÉSTAS CONSÚLTENOS  EN www.merkokasa.es'}

{'es-ES': 'Se vende  piso de 120m2. Distribuido en cuatro habitaciones,  ( la principal con armarios empotrados  baño con ducha hidromasaje y vestidor), el resto de habitaciones sin armarios,  un baño completo con bañera exterior, salón comedor amplio y luminoso con persianas motorizadas,  cocina amplia semi-amueblada y zona de tendedero independiente con un lavadero pequeño . Calefacción central gas ciudad con contador individual.  Dispone de ascensor, plaza de garaje amplia  y trastero. 
 La vivienda ventanas de PVC triple acristalamiento abatibles,   domótica en toda la vivienda, todo exterior, luminoso. persianas motorizadas. Ideal para una pareja o familia que quiera vivir cerca del centro, con multitud de servicios cercanos, supermercados, zonas verdes, farmacias, zonas de ocio.....

 TENEMOS MÁS VIVIENDAS COMO ESTAS, CONSÚLTENOS www.merkokasa.es'}

{'es-ES': 'Ref.:3212 Bonito y soleado dúplex en la calle Adolfo Suarez, cuenta con una cocina y salón americano, una galería y un aseo en la planta baja, en la planta superior dos dormitorios, un baño completo y una terraza.

Cuenta tambien de un trastero y una amplia plaza de garaje

Listo para entrar a vivir!!!!'}

{'es-ES': 'Piso todo exterior, con una superficie de 135 m2. Distribución en hall, sala de grandes dimensiones, cocina equipada abierta a comedor y con acceso a galería, cuatro dormitorios (uno de ellos suite, con baño completo y vestidor), un baño completo y dos balcones con diferente orientación. 

Vivienda soleada todo el día, es un sexta planta, con ascensor ( llega hasta la planta inmediatamente inferior pero aprobada la obra para que llegue hasta la sexta planta), plaza de garaje opcional en otro edificio aunque puede hacerse uso del garaje comunitario para cargas y descargas. La comunidad dispone de servicio de portería.

Ubicación céntrica con todos los servicios próximos.'}

{'es-ES': 'Fantástica vivienda unifamiliar en bonita finca de 6200 m2 totalmente cerrada. La propiedad cuenta con 349 m2 construidos de vivienda distribuidos en dos plantas. En planta baja nos encontramos con un bonito porche acristalado donde poder disfrutas de las vistas al jardín. Una amplia cocina de estilo rústico totalmente amueblada y equipada con zona de comedor, horno de leña y parrilla, dos despensas, un acogedor salón con chimenea, una sala de estar también con chimenea y un baño completo. En planta primera hay un amplio recibidor con sofás, un baño completo y tres dormitorios dobles, uno de ellos con baño en suite y otro con salida privada a una bonita terraza. Ya en el exterior la propiedad cuenta con una capilla con altar de unos 32 m2. Además, cuenta con diversas instalaciones para disfrutar con familiares y amigos, una fantástica piscina cubierta con zona de baños, vestuarios y gimnasio.  Un cenador / merendero cubierto y totalmente acristalado con amplia mesa y zona de barbacoa y horno de leña y un segundo cenador abierto. Una pista de frontón. Además, cabe destacar la gran bodega, subterránea, excavada en el terreno y a la cual se accede a través de un tronco centenario que nos adentra en un espacio único, donde parar el tiempo y disfrutar de un buen vino. La propiedad cuenta con pozo de agua y calefacción de gasoil.

Cospeito está situado en la comarca de Terra Cha, a 28 km de distancia de la capital provincial, Lugo. Dentro del municipio destaca la laguna de Cospeito, humedal con presencia de numerosas aves que disfrutarán los grandes amantes de la naturaleza. A 100 km de Santiago de Compostela, 85 km de A Coruña y a 60 km de las playas de Foz.
'}

{'es-ES': 'quot;SE VENDE CHALET EN FINCA INDEPENDIENTEquot;

Se vende chalet en Núcleo urbano de Piedrafita do Cebreiro,Lugo, al lado de centro de salud con  superficie construida de 270 m2,
Construida  con materiales de primera calidad . Muy luminoso , con orientación sur. Excelentes vistas como se puede comprobar en las fotos.

La casa está totalmente equipada, tanto en cocina como en el resto de estancias, pudiendo entrar a vivir desde el primer momento.
Consta, en planta baja  de cocina , salón con chimenea francesa, sala de estar,  dos habitaciones  y un baño.
En la planta superior,cuatro habitaciones, un baño.'}

{'es-ES': 'Situado en la Avd. de A Coruña en la zona de la medusa, zona repleta de servicios (colegios, farmacias, ocio, alimentacion ) y de accesos directos y salidas inmediatas.

Edificio del año 2002 con reciente mejora de fachadas exteriores (SATE) y patios de luces. Calefacción central con contador individual. El piso con muy poco uso está muy bien cuidado.

Con unos 90 metros cuadrados aproximados y una distribución de tres dormitorios, salón comedor, cocina equipada, dos baños completos y tendedero independiente, ademas de un patio con acceso privado. Con plaza de garaje y trastero.'}

{'es-ES': 'Piso en Alicante zona Centro, 110 m. de superficie,  una habitación doble y 2 habitaciones sencillas, 2 baños, propiedad para entrar a vivir, cocina equipada, carpinteria interior de roble, orientación sur, mármol, carpintería exterior de aluminio / climalit.
 Extras: agua, aire acond. central, aire acondicionado, armarios empotrados, ascensor, bomba frío y calor, calefacción, calefacción central, despensa, galería, luminoso, luz, muebles, ojos de buey, puerta blindada, puertas automático, terraza acristalada, videoportero, vivienda adaptada, autobuses, árboles, céntrico, centros comerciales, centros médicos, cerca de universidad, costa, hospitales, supermercados, tranvía, tren, vistas despejadas, zona de paso, zonas infantiles, garaje  incluido
 
 Alquiler: 850 € MES'}

{'es-ES': 'Preciosa vivienda en venta en San Cosme. En ayuntamiento de Barreiros. En A mariña oriental Lucense.
Conjunto de pisos tipo apartamento distribuidos en salón-comedor, cocina, 2 habitaciones y 1 baño. Exteriores y muy luminosos. Con suelos de madera (excepto en cocina y baños que son cerámicos), carpintería exterior e interior de madera y calefacción. 

Ideales para disfrutar en vacaciones y fines de semana de un ambiente tranquilo y familiar. En un residencial situado en vía principal, contando con buenas comunicaciones por carretera.'}

{'es-ES': 'Se vende  apartamento de 60m2.Distribuido en dos habitaciones , un baño completo con bañera, salón comedor amplio y  cocina amueblada con zona tendedero independiente. Calefacción central con contador individual. Dispone de ascensor, plaza de garaje y trastero.
 Vivienda ideal para una pareja o inversión, se ubica cercano a las universidades, zona tranquila , con multitud de servicios cercanos, supermercados, zonas de ocio, zonas verdes y buenas salidas hacia la NVI.

 CONSÚLTENOS, TENEMOS MÁS VIVIENDAS COMO ESTAS EN www.merkokasa.es'}

{'es-ES': 'Casa situada en la Av. de Madrid, al lado de las Universidades y rodeada de zonas verdes y deportivas.

Dispone de dos plantas y un total de 226m2, distribución en cocina, salón comedor, tres dormitorios, dos baños, trastero, balcón y patio trasero con acceso independiente.

Calefacción de gasoil, agua y saneamiento municipal.'}

{'es-ES': 'En la localidad de Vilalba (Lugo), se vende duplex en buen estado de uso, tiene en la planta baja: La cocina, sala, terraza, un baño, dos habitaciones y un trastero. En la planta alta hay un baño y cuatro habitaciones; pero una de ellas está acondicionada como vestidor.
La vivienda dispone de calefacción, ascensor y una plaza de garaje en el mismo edificio

'}

{'es-ES': 'En Illas canarias, vivienda en sitio llano, al lado del parque de Milagrosa y zona nueva milagrosa, es un barrio con servicios (supermercados, comercios, colegios). Resultando tanto las salidas como entradas en la ciudad inmediatas, al centro se accede por sitio llano por zona comercial.

Edificio en buen estado del año 1973, calefacción de gas ciudad, vivienda en buen estado lista para entrar, comunidad económica de 13 € aprox.

Con una superficie de 96 m2 aproximados construidos, resultando amplia. Distribución de tres dormitorios en buen estado, habitaciones amplias, con baño completo y ventilación natural. Salón comedor. Cocina equipada. Esta vivienda también tiene una terraza amplia de 25 m2 aproximados.'}

{'es-ES': 'Se vende piso a estrenar en calle Portugal, con reforma integral de instalaciones, puertas, ventanas, paredes, suelos, cocina y baños.
Distribución en cocina con despensa, salón-comedor, tres habitaciones espaciosas y dos baños. Piso exterior con salida a dos calles y dos balcones.

El piso tiene ascensor, trastero y plaza de garaje.'}

{'es-ES': 'Vivienda tipo duplex en zona de Aceña de Olga, cerca de fingoi, en "Alfonso X O sabio", una de las zonas mas valoradas por su cantidad de espacios verdes.

Distribución de tres dormitorios y dos baños completos, con salón comedor y cocina equipada, con amplia zona de trabajo.

Con plaza de garaje y trastero. En muy buen estado para entrar a vivir. Los baños están actualizados'}

{'es-ES': 'Totalmente reformado. Apartamento soleado en quinta planta, con ascensor y situado en zona de la Av. de la Coruña con todos los servicios próximos.
Dispone de una amplia terraza acristalada con lavadora, secadora y lavadero. Cocina completamente equipada, salón- comedor, dos dormitorios dobles con armario empotrado, baño completo con columna de hidromasaje y un trastero.

La reforma incluye aislamientos, instalaciones, puertas, ventanas, suelos, cocina y baño. Se vende amueblado.'}

{'es-ES': 'A cincuenta metros de "Porta Nova" a su paso por rua do Camiño Real. Pertenece a un barrio centrico de la zona comercial historica de Lugo, cerca de una de las escaleras de acceso a la parte alta de la muralla, perfecto para dar paseos.

El edificio de la época de los 80 que cuenta con ascensor para cuatro personas aprox. con fachada a "rua da xesta" y parte posterior a patio de manzana amplio con orientación suroeste de sol de tardes, el piso esta en planta alta por donde entra el sol por la mañana, atraves de cinco ventanas destacando la de la habitación principal.

Vivienda de 107 m2 aprox, con huecos para cuatro habitaciones, salón, cocina y dos cuartos de baño completos y con ventana, tiene un tendedero galería anexo a la cocina. Necesita de una continuación para completar la vivienda, con buena distribución ( como finalizar suelos, instalaciones, luminarias, etc.)'}

{'es-ES': 'La vivienda está  reformada, con dos terrazas a la calle. Consta de salón, tres dormitorios dobles, cocina con office y un baño. Muy luminoso, calefacción, parquet y ventanas de aluminio. 

Todos los dormitorios tienen armarios y además cuenta con armario doble en recibidor y varios armarios en terraza. 

Cuenta con una superficie adicional de 60 m2 correspondiente a trastero, garaje y desván.'}

{'es-ES': 'Estupendo apartamento muy soleado y con terraza de 100 m2.

Distribución en cocina, salón- comedor, despensa, habitación tipo suite con baño y otro baño completo con columna de hidromasaje y sauna.

La vivienda dispone de todos los servicios, cuenta con ascensor, plaza de garaje y trastero. Se vende amueblado.'}

{'es-ES': 'A 19 km de Lugo. Preciosa casa de piedra independiente con finca cerrada de 5.000 m2. Dispone de anexos con uso de garaje y trastero.
La casa se encuentra totalmente reformada en exterior con fachada y cubierta terminadas, necesita acabado de interiores.

Buen acceso y comunicación con Lugo ciudad.'}

{'es-ES': 'PISO EN VENTA , ZONA RESIDENCIAL, DISTRIBUCIÓN 3 DORMITORIOS, 2 BAÑOS COMPLETOS, 1 SALÓN,  COCINA, 3 ARMARIOS EMPOTRADOS, GARAJE, TRASTERO Y ASCENSOR.
ZONAS VERDES, CONSTRUCCIÓN 2005 . ACCESO CON MOVILIDAD REDUCIDA





PRÁCTICAMENTE SIN ESTRENAR'}

{'es-ES': 'Se vende apartamento de 65m2. Distribuido en salón comedor sin amueblar  amplio y luminoso, cocina equipada con todos los electrodomésticos, dos habitaciones  ( la habitación principal  con armario empotrado y con baño con ducha), la otra habitación cama nido con armario  y otro baño con bañera amplio .Calefacción de gas ciudad con contador individual. Dispone de ascensor, garaje y trastero anexo.
 Su ubicación es cercano a Fonte dos Ranchos, buenas salidas hacia la NVI, supermercados, zonas verdes ....

 TENEMOS MÁS VIVIENDAS COMO ESTAS EN NUESTRA WEB, CONSÚLTENOS www.merkokasa.es'}

{'es-ES': 'Se vende casa de campo de 240 m2.Distribuida en dos plantas; Planta baja encontramos cocina  de leña amplia con vistas al jardín,  amplio comedor para  con barbacoa y salón con chimenea francesa ( paredes de piedra) y un baño con plato de ducha. Parte alta tres habitaciones, un baño completo y recibidor amplio. Tiene un altillo diáfano .Calefacción de gasoil. Anexos a la vivienda zona con cocina de butano, arcón y zona de trabajo ( cuadras, leñera, garaje y gallinero). Finca de 6.000 m2 totalmente cerrada con un estanque de peces.. Dispone  de agua de pozo, traída y fosa séptica. No tiene placa suelos de madera , placa sólo en el comedor. La casa es de piedra está semi-reformada, la mayoría de las estancias están las paredes de piedra.

 La vivienda se encuentra en la zona de castro de rei, con multitud de servicios cercanos , bus escolar delante de la puerta,  a 45 minutos de la Playa de las Catedrales, a Lugo en 32 kms. Ideal para una familia que quiera vivir en la zona rural con tranquilidad.

 TENEMOS MÁS VIVIENDAS COMO ESTAS, CONSÚLTENOS EN www.merkokasa.es'}

{'es-ES': 'Magnífica promoción de pisos en el ayuntamiento de Burela. En plena mariña Lucense.
Vivienda distribuida de 1 a 3 habitaciones y de 1 a 2 baños. Ubicada en una zona turística próxima a la avenida Arcadio Pardiñas, vía principal del entorno. Cerca de superficies comerciales, centros médicos y de la estación de tren Burela. A unos minutos de la playa. 


No deje pasar esta oportunidad, y coordine una visita...'}

{'es-ES': 'A 9 km de Lugo. Casa independiente en finca de 3.000 m2 con 2000 m2 edificables y parcelables de 600 m2. La casa necesita reforma y se encuentra en zona de Ribas de Miño.

