{'es-ES': 'Vivienda unifamiliar de 686 m2 construidos según catastro distribuidos en cuatro plantas. En la planta baja, a nivel del fantástico jardín tenemos un gran porche con columnas, muy amplio donde poder disfrutar de las vistas a la propiedad, ya dentro de la propiedad tenemos tres dormitorios, dos baños completos y un gran despacho con chimenea y horno antiguo. En la planta primera, donde tenemos la entrada a nivel de la calle principal, contamos con un gran dormitorio en suite con baño completo, un salón o sala de estar, un comedor, la cocina totalmente equipada y amueblada y un gran salón acristalado con fantásticas vistas a la finca de la propiedad. En planta segunda, seis dormitorios, dos de ellos en suite con baño completo y vistas al jardín, dos baños mas para dar servicio a la vivienda. La tercera planta, en bajo cubierta, está totalmente diáfana y actualmente no tiene un uso definido, solo como trastero. La finca cerrada en todo su perímetro esta totalmente arbolada, con zonas de césped y plantas ornamentales, así como un cruceiro de piedra. Calefacción eléctrica. Aparcamiento para varios vehículos en superficie. La propiedad se vende amueblada.

Situada a 2 km de la carretera comarcal 634, en la parroquia vivariense de Galdos. Ubicada en el extremo norte de una parcela de unos 13.000 m2.  A 5.5 km del núcleo urbano de Viveiro y la ría que lleva su nombre donde nos encontramos con playas de arena blanca y preciosos paisajes.
